import ReactPlayer from "react-player";

const Video = ({ selectedLaunch }) => {
  if (!("links" in selectedLaunch)) {
    return (
      <>
        <h1>Mission Videos</h1>
        <ReactPlayer
          url="https://www.youtube.com/embed/TeVbYCIFVa8?autoplay=1"
          playing={true}
          muted={true}
          controls={true}
        />
      </>
    );
  }

  return (
    <>
      <h1>Mission Videos</h1>
      <h2 style={{ color: "white" }}>{selectedLaunch.name} </h2>
      <ReactPlayer
        url={
          "https://www.youtube.com/embed/" +
          selectedLaunch.links.youtube_id +
          "?autoplay=1"
        }
        playing={true}
        muted={true}
        controls={true}
      />
    </>
  );
};

export default Video;
